def apply_rule(i, tokens, tags, cond, label): 
    l = len(cond)
    if tokens[i-l+1:i+1] == cond:
        for j in range(i-l+1,i+1):
            tags[j] = label




def apply_gap_rule(i, tokens, tags, cond1, spaces, cond2, label, not_list):
    l1 = len(cond1)
    l2 = len(cond2)
    s1 = i - l1 - l2 - spaces + 1
    s2 = s1 + l1
    s3 = s2 + spaces
    if tokens[s1:s2] == cond1:
        if tokens[s3:i+1] == cond2:
            for w in not_list:
                if w in tokens[s2:s3]:
                    return
            for j in range(s1,i+1):
                tags[j] = label





